path.onmouseover:
var svg = document.getElementsByTagName('svg')[0];
var pt = svg.createSVGPoint();
pt.x = evt.clientX; 
pt.y = evt.clientY;
var id = evt.target.id;
var cursorpt = pt.matrixTransform(svg.getScreenCTM().inverse());
var xmlns = 'http://www.w3.org/2000/svg';
evt.target.style.stroke = 'red'; 
var elem = document.createElementNS(xmlns, 'text'); 
elem.setAttributeNS(null, 'x', cursorpt.x); 
elem.setAttributeNS(null, 'y', cursorpt.y); 
elem.setAttributeNS(null, 'font-size', 8);
elem.setAttributeNS(null, 'name', 'track_popup');
elem.setAttributeNS(null, 'text-align', 'center');
var text = document.createTextNode(id); 
elem.appendChild(text);
svg.appendChild(elem);

SVGRect = elem.getBBox();
var rect = document.createElementNS(xmlns, 'rect');
rect.setAttribute('x', SVGRect.x);
rect.setAttribute('y', SVGRect.y);
rect.setAttribute('width', SVGRect.width);
rect.setAttribute('height', SVGRect.height);
rect.setAttribute('fill', 'white');
rect.setAttribute('name', 'track_popup_bg');
svg.insertBefore(rect, elem);

path.onmouseout:
evt.target.style.stroke = 'none';
var elem = document.getElementsByName('track_popup')[0]; elem.remove();
var elem = document.getElementsByName('track_popup_bg')[0]; elem.remove();
